import React, { Component, useState } from 'react';
import { Container, Tab, Tabs } from 'react-bootstrap';
import Project from './projectsComponents/project';

const repos = fetch("https://api.github.com/users/paul-rosero/starred")
.then(promise => promise.json())
.then(data => { 
    repos = data.map( repo => { return repo })
})

console.log(repos)
function ControlledTabs() {
    const [key, setKey] = useState('react');
    return (
        <Tabs id="hi" activeKey={key} onSelect={(tab) => setKey(tab)}>
            <Tab eventKey="react" title="React Projects">
                <Project projects={ repos } />
            </Tab>

            <Tab eventKey="profile" title="Profile">

            </Tab>
        </Tabs>
    );
}

class Projects extends Component {

    render() {
        return (
            <Container>
                <ControlledTabs />
            </Container>    
        );
    }
}

export default Projects;
